import './history.css'
import Plus from "../../../assets/images/plusCopy.svg";


export default function History(){
    return(
        <div className="button-component">
            <div className="button-history">
                <button className="history"> <img className="plus" src={Plus} alt="history-button"/> History</button>
            </div>
        </div>
    )
}
